import { getMetadata } from '../../scripts/aem.js';
import { loadFragment } from '../fragment/fragment.js';

/**
 * Toggles the visibility of a submenu
 * @param {HTMLElement} dropdown The dropdown element
 */
function toggleSubMenu(dropdown) {
  const expanded = dropdown.getAttribute('aria-expanded') === 'true';
  dropdown.setAttribute('aria-expanded', expanded ? 'false' : 'true');
}

export default async function decorate(block) {
  const navMeta = getMetadata('nav');
  const navPath = navMeta ? new URL(navMeta, window.location).pathname : '/nav';
  const fragment = await loadFragment(navPath);
  block.textContent = '';
  const nav = document.createElement('nav');
  nav.id = 'nav';
  nav.setAttribute('aria-expanded', 'false');

  const sections = ['navHeader', 'navMenu1', "navCtas", 'nav-utility-link', "navSocial", "navFoot"]
  let i=0;
  while (fragment.firstElementChild) {
    fragment.firstElementChild.classList.add(sections[i])
    nav.append(fragment.firstElementChild);
    i++;
  }
  const navHeader = nav.querySelector('.navHeader');
  const navFoot = nav.querySelector('.navFoot');
  navHeader.innerHTML = `${brandLogo()} <span class="mainToggle" id="mainToggle">☰</span>`;
  navFoot.innerHTML = '<svg xmlns="http://www.w3.org/2000/svg" aria-hidden="true"><use href="#icons-pfizer"></use></svg>'
  const navWrapper = document.createElement('div');
  navWrapper.className = 'nav-wrapper';
  navWrapper.append(nav);
  block.append(navWrapper);

  const navSocial = nav.querySelector('.navSocial');
  navSocial.querySelectorAll('li>a').forEach((item)=>{
    item.classList.add('social-button');
    item.innerHTML = `<span class="social-icon"><svg xmlns="http://www.w3.org/2000/svg"><use href="#icons-${item.textContent}"></use></svg><span>`
    
  })
  // Add dropdown toggle functionality for lists with sublists
  nav.querySelectorAll('li').forEach((listItem) => {
    const sublist = listItem.querySelector('ul');
    if (sublist) {
      listItem.classList.add('nav-drop');
      listItem.setAttribute('aria-expanded', 'false');

      // Add a toggle button
      const toggleButton = document.createElement('button');
      toggleButton.className = 'nav-toggle-button';
      toggleButton.setAttribute('aria-label', 'Expand/Collapse submenu');
      toggleButton.innerHTML = '▼';
      listItem.prepend(toggleButton);

      // Add event listener for toggling submenu
      toggleButton.addEventListener('click', () => toggleSubMenu(listItem));
    }
  });

  // Add hamburger menu toggle for mobile view
  const mainToggleButton = document.getElementById('mainToggle');
  mainToggleButton.addEventListener('click', () => {
    const expanded = nav.getAttribute('aria-expanded') === 'true';
    nav.setAttribute('aria-expanded', expanded ? 'false' : 'true');
    document.body.style.overflowY = expanded ? '' : 'hidden'; // Lock scrolling
  });
  // remove header toggle button block.prepend(mainToggleButton);
  const rect = document.body.getBoundingClientRect();
  navWrapper.style.left=rect.x + 'px'
  window.addEventListener('resize',()=>{
    const rect = document.body.getBoundingClientRect();
    navWrapper.style.left=Math.max(rect.x,0) + 'px'
  })
}

